//Universal A(i, j, k, l, m, n, o, )*B(p, q, r, s, ) triple contraction
template<class A, class B, class T, class U, int Dim0, int Dim1, int Dim2, int Dim3, int Dim4, int Dim5, int Dim6, int Dim7, int Dim8, int Dim9, int Dim10, char i, char j, char k, char l, char m, char n, char o, char p, char q, char r, char s, int DimA, int DimB, int DimC, int DimD, int DimX, int DimY, int DimZ, int DimW, char a, char b, char c, char d, char x, char y, char z, char w>
class Tensor7_times_Tensor4_triple
{
  Tensor7_Expr<A, T, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, Dim6, i, j, k, l, m, n, o> iterA;
  Tensor4_Expr<B, U, Dim7, Dim8, Dim9, Dim10, p, q, r, s> iterB;

public:
  typename promote<T, U>::V operator()(const int N1, const int N2, const int N3, const int N4, const int N5) const
  {
    typename promote<T, U>::V result(0);
    for(int xx = 0; xx < DimX; ++xx)
      for(int yy = 0; yy < DimY; ++yy)
        for(int zz = 0; zz < DimZ; ++zz)
          {
            // Permutation is where the indices get checked.
            result += Permutation7<DimA, DimB, DimC, DimD, DimX, DimY, DimZ, a, b, c, d, x, y, z>().eval(
              iterA, N1, N2, N3, N4, xx, yy, zz) * Permutation4<DimX, DimY, DimZ, DimW, x, y, z, w>().eval(iterB, xx, yy, zz, N5);
          }
    return result;
  }

  Tensor7_times_Tensor4_triple(
    const Tensor7_Expr<A, T, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, Dim6, i, j, k, l, m, n, o> &iter_a,
    const Tensor4_Expr<B, U, Dim7, Dim8, Dim9, Dim10, p, q, r, s> &iter_b)
      : iterA(iter_a), iterB(iter_b)
  {}
};

//A(i, j, k, l, m, n, o, )*B(k, j, i, p, )
template<class A, class B, class T, class U, int Dim0, int Dim1, int Dim2, int Dim3, int Dim4, int Dim5, int Dim6, int Dim7, char i, char j, char k, char l, char m, char n, char o, char p>
auto operator*(const Tensor7_Expr<A, T, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, Dim6, i, j, k, l, m, n, o> &a,
               const Tensor4_Expr<B, U, Dim2, Dim1, Dim0, Dim7, k, j, i, p> &b)
{
  using TensorExpr
    = Tensor7_times_Tensor4_triple<A, B, T, U, Dim0, Dim1, Dim2, Dim3, Dim4, Dim5, Dim6, Dim2, Dim1, Dim0, Dim7, i, j, k, l, m, n, o, k, j, i, p, Dim3, Dim4, Dim5, Dim6, Dim0, Dim1, Dim2, Dim7, l, m, n, o, i, j, k, p>;
  return Tensor5_Expr<TensorExpr, typename promote<T,U>::V, Dim3, Dim4, Dim5, Dim6, Dim7, l, m, n, o, p>(TensorExpr(a, b));
}

